import './App.css';
import rat from './img/짭쥐 표지-15.png';
import img1 from './img/짭쥐 표지-16.png';
import img2 from './img/짭쥐 표지-17.png';
import img3 from './img/짭쥐 표지-18.png';
import img4 from './img/짭쥐 표지-19.png';
import img5 from './img/짭쥐 표지-20.png';

function App() {
  return (
    <div >
      <img src={img1}/>
      <img src={img2}/>
      <img src={img3}/>
      <img src={img4}/>
      <img src={img5}/>
      <img src={rat}/>
    </div>
  );
}

export default App;
